class Solution:
    def minimumBeautifulSubstrings(self, s: str) -> int:
        dp = [float('inf')] * (len(s) + 1)
        dp[0] = 0
        powers_of_five = set()
        current = 1
        while current <= int("1" * len(s), 2):
            powers_of_five.add(bin(current)[2:])
            current *= 5

        for i in range(1, len(s) + 1):
            for j in range(i):
                if s[j:i] in powers_of_five and (j == 0 or s[j] != '0'):
                    dp[i] = min(dp[i], dp[j] + 1)

        return dp[-1] if dp[-1] != float('inf') else -1
